import React, { Component } from 'react';

class Modal extends Component {
    render() {
        return (
            <div className="MyModal">
                <div className="content">
                    <div>{this.props.onTest.title}</div>
                    <div>{this.props.onTest.author}</div>
                    <div>{this.props.onTest.publishedAt}</div>
                    <div>{this.props.onTest.description}</div>
                    <div>{this.props.onTest.content}</div>
                    {this.props.onTest.urlToImage ? <img src = {this.props.onTest.urlToImage} className = "articleImg"/> : <img src = "https://c-lj.gnst.jp/public/img/common/noimage.jpg?20181001050045" className = "articleImg"/>}
                    <div>{this.props.onTest.author}</div>

                    <button onClick = {this.props.onClose} className = "button">닫기</button>
                </div>
            </div>
        );
    }
}

export default Modal;
